import React from 'react';
import styled from "styled-components";

const Wrapper = styled.div`
  align-items: center;
  background-color: rgba(0, 0, 0, 0.3);
  display: flex;
  flex-flow: column nowrap;
  padding: 20px 30px 30px 17px;
  width: 146px;

> div > a {
  color: white;
  display: block;
  font-weight: 500;
  padding: 9px 0;
  text-decoration: none;
}

> div > a:hover {
  color: #dddddd;
}

> div > hr {
  border: 1px solid rgba(255, 255, 255, 0.15);
}
`;

/*

    [
        {
            label: 'Teams',
            to: '#'

        },
        {
            label: 'Teams',
            to: '#'

        },
        {
            label: 'Teams',
            to: '#'

        },
        null
    ]

 */

const MainNavigationBoxExtras = ({ links }) => {

    return (
        <Wrapper>
            <div>
                {links.map((linkOrSeparator, index) => {
                    if (linkOrSeparator === null) {
                        return <hr key={index} />;
                    }
                    return (
                      <a href={linkOrSeparator.to} key={index}>
                          {linkOrSeparator.label}
                      </a>
                    );
                })}
                <a href={'#'}>Trends</a>
                <a href={'#'}>Goods for Sale</a>
                <a href={'#'}>Meetups</a>
                <hr/>
                <a href={'#'}>Dribble Shop</a>
                <a href={'#'}>About Dribble</a>
                <a href={'#'}>Advertise</a>

            </div>

        </Wrapper>
    )

};

export default MainNavigationBoxExtras;
